    <!-- Add a team to the list when the button is clicked -->
    <script>
        function enterTeam() {
            const teamName = document.getElementById('team').value;
            if (teamName.trim() == '') {
                return;
            }
            if (teamList.includes(teamName)) {
                alert('El equipo ya existe');
                return;
            }
            teamList.push(teamName);
            addTeamRow(teamName);
            document.getElementById('team').value = '';
        }
        let teamList = [];
        document.getElementById('add-team')
            .addEventListener('click', () => {
                enterTeam()
            });
        document.getElementById('team')
            .addEventListener('keydown', (event) => {
                if (event.key === 'Enter') {
                    enterTeam()
                }
            })
    </script>
    <script>
        document.getElementById('clear-schedule').addEventListener('click', () => {
            teamList = [];
            const table = document.getElementById('teams-table-body');
            table.innerHTML = '';
        });
    </script>

    <script>
        function deleteTeam(teamName) {
            const index = teamList.indexOf(teamName);
            if (index > -1) {
                teamList.splice(index, 1);
                const row = document.getElementById(`row-${teamName}`);
                row.remove();
                for (let i = index; i < teamList.length; i++) {
                    const indexName = i + 1;
                    const teamName = teamList[i];
                    const after_row = document.getElementById(`row-${teamName}`);
                    after_row.children[1].innerHTML = indexName;
                    if (indexName % 2 == 0) {
                        after_row.className = 'bg-gray-50';
                    } else {
                        after_row.className = 'bg-white';
                    }
                }
            } else {
                alert('El equipo no existe');
            }
        }
    </script>
    <script>
        const brackets_names = {
            "F": "FINAL",
            "SF": "SEMIFINAL",
            "QF": "CUARTOS DE FINAL",
            "8Q": "OCTAVOS",
            "16Q": "DIECISEISAVOS"
        }
        function generateSchedule() {
            const category = document.getElementById('category').value;
            const sex = document.getElementById('sex').value;
            const type = document.getElementById('schedule_type').value;

            let matches
            let output_html;
            switch (type) {
                case 'league-single':
                    matches = generateSingleLeagueSchedule(teamList, category, sex);
                    output_html = generateIndividualTable(matches);
                    
                    fireAlert(matches, output_html, type, category, sex);
                    break;
                case 'league-double':
                    matches = generateDoubleLeagueSchedule(teamList, category, sex);
                    output_html = generateIndividualTable(matches);

                    fireAlert(matches, output_html, type, category, sex);
                    break;
                case 'brackets':
                    matches = generateBracketsSchedule(teamList, category, sex);
                    output_html = generateMultipleTable(matches);

                    fireAlert(matches, output_html, type, category, sex);
                    break;
                case 'combo-single':
                    matches = generateComboSchedule(teamList, category, sex, 'single');
                    output_html = generateMultipleTable(matches);

                    fireAlert(matches, output_html, type, category, sex);
                    break;
                case 'combo-double':
                    matches = generateComboSchedule(teamList, category, sex, 'double');
                    output_html = generateMultipleTable(matches);

                    fireAlert(matches, output_html, type, category, sex);
                    break;
                default:
                    Swal.fire({
                        icon: 'error',
                        title: 'Error',
                        text: 'No se pudo generar el cuadrante, tipo de competición no reconocido.',
                    })
                    break;
            }
        }

        function fireAlert(matches, output_html, type, category, sex) {
            Swal.fire({
                title: 'Partidos generados',
                html: output_html,
                showCancelButton: true,
                confirmButtonText: 'Guardar en PDF',
                cancelButtonText: 'Salir',
                showLoaderOnConfirm: true,
                preConfirm: async () => {
                    try {
                        await generatePDF(
                            matches,
                            category,
                            sex,
                            type
                        );
                    } catch (error) {
                        Swal.showValidationMessage(`
                            Error al generar el PDF.\n${error}
                        `);
                    }
                },
                allowOutsideClick: () => !Swal.isLoading()

            }).then((result) => {
                if (result.isConfirmed) {
                    Swal.fire({
                        title: "PDF generado correctamente",
                        icon: "success",
                        toast: true,
                        position: "top-end",
                        timer: 5000,
                        timerProgressBar: true,
                        showConfirmButton: false
                    });
                }
            })
        }

        function generateSingleLeagueSchedule(teams, category, sex, shuffle = true) {
            const remaining_teams = [...teams];
            let matches = [];
            teams.forEach((team) => {
                let team_index = remaining_teams.indexOf(team);
                remaining_teams.splice(team_index, 1);
                remaining_teams.forEach((other_team) => {
                    matches.push({ team: team, opponent: other_team });
                });
            })
            if (shuffle) {
                matches = shuffleArray(matches);
            }

            return matches
        }

        function generateBracketsSchedule(teams, category, sex, shuffle = false) {
            const brackets_round_types = {
                2: "F",
                4: "SF",
                8: "QF",
                16: "8Q",
                32: "16Q",
            }
            const min_n_teams = [4, 8, 16, 32];
            const n_teams = min_n_teams.find((n) => n >= teams.length);
            if (teams.length < n_teams) {
                teams = teams.concat(Array.from({ length: n_teams - teams.length }, (_, i) => `DESCANSA`));
            }
            if (shuffle) {
                teams = shuffleArray(teams);
            }

            let matches = {};
            // Calculate N rounds
            const n_rounds = Math.log2(n_teams);
            // Define first round with given teams
            let first_round = [];
            for (let i = 0; i < n_teams / 2; i++) {
                first_round.push({ team: teams[i], opponent: teams[n_teams - 1 - i] });
            }
            matches[brackets_round_types[n_teams]] = first_round;
            // Calculate other rounds
            for (let i = 2; i <= n_rounds; i++) {
                let matches_round = [];
                let n_teams_left = n_teams / Math.pow(2, i - 1);
                let winners = Array.from({ length: n_teams_left }, (_, index) => `Ganador ${brackets_round_types[n_teams_left * 2]}-${index + 1}`);

                for (let j = 0; j < n_teams_left / 2; j++) {
                    matches_round.push({ team: winners[j], opponent: winners[n_teams_left - 1 - j] });
                }
                matches[brackets_round_types[n_teams_left]] = matches_round;
            }
            return matches;
        }

        function generateDoubleLeagueSchedule(teams, category, sex, shuffle = true) {
            let matches1 = generateSingleLeagueSchedule(teams, category, sex, shuffle);
            let matches2 = [];
            matches1.forEach((match) => {
                matches2.push({ team: match.opponent, opponent: match.team });
            })
            return [...matches1, ...matches2];
        }

        function generateComboSchedule(teams, category, sex, type, shuffle = true) {
            let league_matches = [];
            switch (type) {
                case 'single':
                    league_matches = generateSingleLeagueSchedule(teams, category, sex, shuffle);
                    break;
                case 'double':
                    league_matches = generateDoubleLeagueSchedule(teams, category, sex, shuffle);
                    break;
                default:
                    break;
            }
            const bracket_teams = teams.map((team) => {
                return String(teams.indexOf(team) + 1) + "º";
            })
            let bracket_matches = generateBracketsSchedule(bracket_teams, category, sex, shuffle);
            return {
                "LIGA": league_matches,
                ...bracket_matches
            }
        }
    </script>

    <script>
        function generateIndividualTable(games, title = "") {
            return `
                 <div class="schedule-table w-full max-h-[400px] overflow-auto mb-4 space-y-2">
                    <h2 class="text-lg font-bold text-gray-800">${title}</h2>
                    <table class="w-full border-collapse border border-2 border-gray-100">
                        <thead class="text-sm font-semibold text-gray-800 bg-gray-100 mx-auto">
                            <tr>
                                <th>#</th>
                                <th class="p-2">Local</th>
                                <th class="p-2"></th>
                                <th class="p-2">Visitante</th>
                            </tr>
                        </thead>
                        <tbody>
                            ${games.map((game, index) => `
                                <tr class="${index % 2 == 0 ? 'bg-gray-50' : 'bg-transparent'}">
                                    <td class="p-2 text-sm text-gray-600">${index + 1}</td>
                                    <td class="p-2">${game.team}</td>
                                    <td class="p-2">vs</td>
                                    <td class="p-2">${game.opponent}</td>
                                </tr>
                            `).join('')}
                        </tbody>
                    </table>
                </div>`;
        }

        function generateMultipleTable(games_object) {
            return Object.entries(games_object).map(([round, games]) => {
                const title = brackets_names[round] ? brackets_names[round] : round;
                return generateIndividualTable(games, title);
            }).join('');
        }
    </script>

    <script>
        function shuffleArray(array) {
            const output = array
                .map(value => ({ value, sort: Math.random() }))
                .sort((a, b) => a.sort - b.sort)
                .map(({ value }) => value)
            return output
        }
    </script>

    <script>
        const rename_type = {
            "league-single": "Liga a un partido",
            "league-double": "Liga a doble partido",
            "brackets": "Playoff",
            "combo-single": "Liga a un partido y playoff",
            "combo-double": "Liga a doble partido y playoff"
        }
        async function generatePDF(games, category, sex, type) {

            function addTablePDF(doc, games, start) {
                var columns = [
                    { title: "", dataKey: "id" },
                    { title: "Equipo 1", dataKey: "team" },
                    { title: "", dataKey: "vs" },
                    { title: "Equipo 2", dataKey: "opponent" }
                ];
                var rows = games.map((game, index) => {
                    return {
                        id: index + 1,
                        team: game.team,
                        vs: "vs",
                        opponent: game.opponent
                    }
                })

                // Generating table
                doc.autoTable(columns, rows, {
                    tableWidth: 'auto',
                    styles: {
                        halign: "center",
                        valign: "middle",
                        cellPadding: 5,
                        fontSize: 12,
                        fillColor: [22, 163, 74],
                    },
                    bodyStyles: { fillColor: null },
                    columnStyles: {
                        "id": { cellWidth: "wrap", fontSize: 10, halign: "right", textColor: [150, 150, 150] },
                        "vs": { cellWidth: "wrap", fontSize: 10, textColor: [150, 150, 150] },
                    },
                    startY: start
                });
            }
            // Creating pdf and adding header
            const doc = new jsPDF({
                orientation: 'l',
                unit: 'pt'
            })

            doc.addImage(
                ebg_logo,
                'PNG',
                40,
                20,
                35,
                40
            );

            doc.setFontSize(18)
            doc.setFontStyle("bold")
            doc.text(category + " " + sex, 80, 39)

            doc.setFontSize(12)
            doc.setFontStyle("normal")
            doc.setTextColor(100)

            doc.text(rename_type[type], 80, 53)

            if (Array.isArray(games)) {
                addTablePDF(doc, games, 68)
            } else if (typeof games === 'function' || typeof games === 'object' && !!games) {
                var rounds = Object.keys(games);
                if (rounds[0] === "LIGA") {
                    var {LIGA, ...brackets_games} = games;
                    // Adding Liga table
                    addTablePDF(doc, LIGA, 68)
                    doc.addPage()

                    // Adding brackets tables
                    Object.entries(brackets_games).map(([round, games_array]) => {
                        const title = brackets_names[round] ? brackets_names[round] : round;
                        var lastY;
                        if (rounds.indexOf(round) == 1) {
                            lastY = 40;
                        } else {
                            lastY = doc.autoTableEndPosY();
                        }
                        doc.setFontStyle("bold")
                        doc.setTextColor(20)
                        doc.text(title, 40, lastY+15)
                        addTablePDF(doc, games_array, lastY+20)
                    })
                } else {
                    Object.entries(games).map(([round, games_array]) => {
                        const title = brackets_names[round] ? brackets_names[round] : round;
                        var lastY
                        if (rounds.indexOf(round) == 0) {
                            lastY = 63;
                        } else {
                            lastY = doc.autoTableEndPosY();
                        }
                        doc.setFontStyle("bold")
                        doc.setTextColor(20)
                        doc.text(title, 40, lastY+15)
                        addTablePDF(doc, games_array, lastY+20)
                    })
                }
            }
            // Save pdf
            doc.save(`cuadrante-${category}_${sex}.pdf`)
        }
    </script>
